package com.audaxis.compiere.eurocenter.process.model;

import java.math.BigDecimal;

public class ACPDoc {

	private int OrderNo;
	private int C_Tax_ID;
	private BigDecimal TotalAmt;
	
	public ACPDoc() {
		// TODO Auto-generated constructor stub
	}
	
	
	public ACPDoc(int C_Order_ID, BigDecimal totalAmt, int c_Tax_ID) {
		super();
		OrderNo = C_Order_ID;
		C_Tax_ID = c_Tax_ID;
		TotalAmt = totalAmt;
	}


	public int getOrderNo() {
		return OrderNo;
	}


	public void setOrderNo(int orderNo) {
		OrderNo = orderNo;
	}


	public int getC_Tax_ID() {
		return C_Tax_ID;
	}


	public void setC_Tax_ID(int c_Tax_ID) {
		C_Tax_ID = c_Tax_ID;
	}


	public BigDecimal getTotalAmt() {
		return TotalAmt;
	}


	public void setTotalAmt(BigDecimal totalAmt) {
		TotalAmt = totalAmt;
	}

}
